import React from 'react';

const StartMenu = ({show, onStart, gameOver}) => {

	return (
		gameOver ? 
			<div>
				<button>Play Again?</button>
			</div> :
			<div>
				<h1>Sports Trivia</h1>
				<div>
					<button onClick={() => onStart(!show)}>Start</button>
				</div>
			</div>
	);
};

export default StartMenu;
